import React, { Component } from 'react'
import './App.css'
import api from './Api'

class App extends Component{

    async componentDidMount(){// realizar uma busca no api
        const reposta = await api.get('ViniciusIshikawa');// await para garantir o resultado do request

    }
    render(){  
        return(
            <div>
                reposta
            </div>
        )
    }
    
}

export default App
